import '../HomeContents/BoilerBioFuel.css';

function BoilerBioFuel() {
    return (
        <div className='page'>
            <div className="body">
                <h1>What is biofuel-boilers? </h1>
                <p> Biofuel-boilers are boilers that use biofuel instead of typical boilers that use fossil
                    fuels (such as petroleum). Biofuel is a "clean" liquid fuel obtained from renewable
                    sources, in particular vegetables oils, animal fats, cooking oils and plants.
                </p>



            </div>
        </div>
    )
}


export default BoilerBioFuel;
